    {
    id: 4,
    title: 'MullvScript',
    category: 'project',
    tags: ['bash', 'vpn', 'automation']
    },
    {
    id: 5,
    title: 'zsh-configs',
    category: 'project',
    tags: ['zsh', 'shell', 'pentesting', 'productivity']
    },
    {
    id: 6,
    title: 'Haze Walkthrough',
    category: 'writeup',
    tags: ['Htb', 'Smb', 'Kerberos', 'Ad', 'Windows', 'ESC16']
    }];

  // Calculate actual tag counts
  const calculateTagCount = (tagName) => {
    return allPosts.filter(post => 
      post.tags.some(postTag => postTag.toLowerCase() === tagName.toLowerCase())
    ).length;
  };

  const tags = [
    {
      name: 'ad',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'asreproast',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'automation',
      count: 2,
      color: '#3D0000'
    },
    {
      name: 'backup-operators',
      count: 1,
