    {
      name: 'bash',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'dcsync',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'hmv',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'ldap',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'password-cracking',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'pentesting',
      count: 2,
      color: '#3D0000'
    },
    {
      name: 'productivity',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'shell',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'smb',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'vpn',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'windows',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'zsh',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'python',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'network',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'security',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'reconnaissance',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'arduino',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'usb',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'htb',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'kerberos',
      count: 1,
      color: '#3D0000'
    },
    {
      name: 'esc16',
